import "./App.css";
import male from "./photos/Mars_symbol.svg.png";
import female from "./photos/Venus_symbol.svg.png";
import back from "./photos/back button.png";
function App() {
  const [gender, genderFunction] = useState("");
  return (
    <React.Fragment>
      <img
        src={back}
        alt="back"
        className="back"
        height="28px"
        onClick={() => {
          console.log("pre page");
        }}
      />
