              <div className="card-body text-dark">Male</div>
            </div>
          </div>
          <div className="col-sm">
            <div className="card text-center">
              <div
                className="overflow"
                onClick={() => {
                  genderFunction("Female");
                }}
              >
                <img alt="Female" src={female} />
              </div>
              <div className="'card-body text-dark">Female</div>
            </div>
          </div>
        </div>
      </div>

      <br /><br /><br /><br /><br /><br />
      <div className="App">
        <button
          className="btn btn-pink "
          onClick={
            gender === "Female" || gender === "Male"
              ? () => {
                  console.log(gender);
                }
              : () => {
                  alert("did not choose");
                  console.log("Did not choose");
                }
          }
        >
          &emsp;&emsp; Next &emsp;&emsp;{" "}
        </button>
      </div>
    </React.Fragment>
  );
}

export default App;
